function About() {
    return (
        <div className="section-detail about-body">
            <h1 id="about-me-title">Everything about me!</h1>
            <h3 className="about-me-detail">
                I'm an iOS Developer based in Bangkok, currently working at ClickNext Ltd. I'm eager to learn new things all the time. Cuz you can always know more, right? I have a dream of working abroad one day in the future, maybe in 2 years or 10. Who knows?
            </h3>
        </div>
    )
}

export default About
